import React from 'react';

const HomePage = () => {
  return (
    <div className="flex">
      <div className="w-1/2 bg-gray-100 p-8">
        <h1 className="text-4xl font-bold mb-4">Welcome to Our Website</h1>
        <p className="text-lg mb-8">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum euismod commodo lectus, id convallis orci pellentesque in. Ut sed consequat turpis.</p>
        <button className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600">Get Started</button>
      </div>
      <div className="w-1/2">
        <img src="https://example.com/image.jpg" alt="Example" className="w-full h-auto" />
      </div>
    </div>
  );
}

export default HomePage;
